import { useSelector } from "react-redux";

const OrderPage = ({ formData }) => {
    const inventory = useSelector(state => state.inventory.items);

    return (
        <Select>
            {inventory.map(item => (
                <MenuItem key={item.id} value={item.name}>
                    {item.name}
                </MenuItem>
            ))}
        </Select>
    );
};
export default OrderPage
